import { Col, Row } from "react-bootstrap";
import { Link } from "react-router-dom";

const ListChapter = ({ itemSubpage }) => {
  return (
    <>
      <Row>
        <Col xl={6}>
          <Link></Link>
        </Col>
      </Row>
    </>
  );
};

export default ListChapter;
